// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import MyCookPage from './pages/MyCookPage'; // Import the new component
import MealListPage from './pages/MealListPage'; // Import MealListPage
import MealSelectionPage from './pages/MealSelectionPage'; // Import the new component
import './App.css';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/login">Login</Link>
            </li>
            <li>
              <Link to="/register">Register</Link>
            </li>
            {/* Placeholder for logged-in state navigation */}
            <li>
              <Link to="/mycook">My COOK Page</Link>
            </li>
            <li>
              <Link to="/select-meal">Select Meal</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/register" element={<RegisterPage />} />
          <Route path="/mycook" element={<MyCookPage />} /> {/* New route */}
          <Route path="/select-meal" element={<MealSelectionPage />} /> {/* New route */}
          {/* We'll add a route for the review form later */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
